import React, { Component } from 'react';
import { Tabs } from 'antd';
import './App.css';
class App extends Component {
  state = {
    resultCount: 0
  };
  Demo = () => (
    <Tabs defaultActiveKey="1" onChange={callback}>
      <TabPane tab="Tab 1" key="1">
        Content of Tab Pane 1
      </TabPane>
      <TabPane tab="Tab 2" key="2">
        Content of Tab Pane 2
      </TabPane>
      <TabPane tab="Tab 3" key="3">
        Content of Tab Pane 3
      </TabPane>
    </Tabs>
  );

  searchZillow = async (event) => {
    event.preventDefault();
    let response = await fetch('/zillow');
    let body = await response.json();
    this.setState({ resultCount: body.searchList.totalResultCount });
  }
  openCity = async (event, cityName) => {
    var i, tabcontent, tablinks;
    tabcontent = document.getElementsByClassName("tabcontent");
    for (i = 0; i < tabcontent.length; i++) {
      tabcontent[i].style.display = "none";
    }
    tablinks = document.getElementsByClassName("tablinks");
    for (i = 0; i < tablinks.length; i++) {
      tablinks[i].className = tablinks[i].className.replace(" active", "");
    }
    document.getElementById(cityName).style.display = "block";
    event.currentTarget.className += " active";
  }
  render() {
    return (

<div className="App">
<header className="App-header">
<div class="tab">
  <button class="tablinks" onClick={(event)=>this.searchZillow(event)}>US</button>
  <button class="tablinks" onClick={(event)=>this.openCity(event,'Ireland')}>Ireland</button>
</div>
<div id="London" class="tabcontent">
  <h3>London</h3>
  <p>London is the capital city of England.</p>
</div>
<div id="Ireland" class="tabcontent">
  <h3>Ireland</h3>
  <p>Dublin is the capital of Ireland.</p> 
</div>
<h2>Properties Found {this.state.resultCount}</h2>
        </header>
    </div>
    );
  }
}
export default App;
